import SearchBar from '../SearchBar/SearchBar';

const Nav = ({ onSearch }) => {

    return (
        <nav>
            <SearchBar onSearch={onSearch}/>
            <SearchBar onClose={onClose}/>
        </nav>
    )
}

export default Nav;
